import React from 'react';

const Rules = () => {
    return (
        <div className='rulesContainer text-end'>
            <div className='ms-auto'>
                <a className="btn btn-primary" data-bs-toggle="offcanvas" href="#offCanvasRules" role="button" aria-controls="offCanvasRules">
                    Rules
                </a>
            </div>
            

            <div className="offcanvas offcanvas-start" tabindex="-1" id="offCanvasRules" aria-labelledby="offCanvasRulesLabel">
                <div className="offcanvas-header">
                    <h5 className="offcanvas-title" id="offCanvasRulesLabel">Offcanvas</h5>
                    <button type="button" className="btn-close" data-bs-dismiss="offcanvas" aria-label="Close"></button>
                </div>
                <div className="offcanvas-body">
                    <div>
                        Some text as placeholder. In real life you can have the elements you have chosen. Like, text, images, lists, etc.
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Rules;
